import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';


function Services() {
  return (
	<Container>
		<Row>
			<Col>
				<h1 class="text-white display-5 fw-bold">C. W. Clean N Go</h1>
			</Col>
		</Row>
	</Container>
  );
}

export default Services;
